import Select from "react-select";
import countryIcon from "../assets/img/landingPage/countryIcon.png";
import sectorIcon from "../assets/img/landingPage/sector-icon.png";
import "./LandingPage.css";
import soflis_meurneoba from "../assets/img/landingPage/iconsForSectors/soflis_meurneoba.svg";
import samtomopovebiti from "../assets/img/landingPage/iconsForSectors/samtomopovebiti.svg";
import damamushavebeli from "../assets/img/landingPage/iconsForSectors/damamushavebeli.svg";
import energetika from "../assets/img/landingPage/iconsForSectors/energetika.svg";
import mshenebloba from "../assets/img/landingPage/iconsForSectors/mshenebloba.svg";
import sastumroebi from "../assets/img/landingPage/iconsForSectors/sastumroebi.svg";
import transporti from "../assets/img/landingPage/iconsForSectors/transporti.svg";
import kavshirgabmuloba from "../assets/img/landingPage/iconsForSectors/kavshirgabmuloba.svg";
import ganatleba from "../assets/img/landingPage/iconsForSectors/ganatleba.svg";







function SelectWorldOrSector(props) {
  const optionsSector = [
    { value: "soflis", label: <div className="selectiondiv"><img src={soflis_meurneoba}  alt='' className="SeqtorebisIcons" />სოფლის მეურნეობა, თევზჭერა</div>  },
    { value: "samto", label: <div className="selectiondiv"><img src={samtomopovebiti}  alt='' className="SeqtorebisIcons" />სამთომოპოვებითი მრეწველობა</div>  },
    { value: "damamushavebeli", label: <div className="selectiondiv"><img src={damamushavebeli}  alt='' className="SeqtorebisIcons" />დამამუშავებელი მრეწველობა</div> },
    { value: "energetika", label: <div className="selectiondiv"><img src={energetika}  alt='' className="SeqtorebisIcons" />ენერგეტიკა</div> },
    { value: "mshenebloba", label: <div className="selectiondiv"><img src={mshenebloba}  alt='' className="SeqtorebisIcons" />მშენებლობა</div> },
    { value: "sastumroebi", label: <div className="selectiondiv"><img src={sastumroebi}  alt='' className="SeqtorebisIcons" />სასტუმროები და რესტორნები</div> },
    { value: "transporti", label: <div className="selectiondiv"><img src={transporti}  alt='' className="SeqtorebisIcons" />ტრანსპორტი</div> },
    { value: "kavshirgabmuloba", label: <div className="selectiondiv"><img src={kavshirgabmuloba}  alt='' className="SeqtorebisIcons" />კავშირგაბმულობა</div> },
    { value: "ganatleba", label: <div className="selectiondiv"><img src={ganatleba}  alt='' className="SeqtorebisIcons" />განათლება</div> },
    { value: "ganatleba", label: <div className="selectiondiv"><img src={ganatleba}  alt='' className="SeqtorebisIcons" />ჯანდაცვა და სოციალური დახმარება</div> },







  ];
  const customStyles = {
    control: (base) => ({
      ...base,
      height: 72,
      minHeight: 72,
      backgroundImage: `url(${ props.tabswitch === "სექტორების" ?  sectorIcon :countryIcon })`,
      backgroundRepeat: "no-repeat",
      width: "100%",
      backgroundPosition: "right 6% top 50%",
      paddingLeft: "6%",
      color: "#808083",
      borderRadius: "10px",
      border: "none",
    }),
  };


  return props.tabswitch === "სექტორების" ? (
    <Select
      name="sector"
      id="sector"
      placeholder="აირჩიეთ სასურველი სექტორი"
      components={{
        DropdownIndicator: () => null,
        IndicatorSeparator: () => null,
      }}
      styles={customStyles}
      className="chooseCountrySelect"
      options={optionsSector}
    />
  ) : (
    <Select
      name="country"
      id="country"
      placeholder="აირჩიეთ სასურველი ქვეყანა"
      components={{
        DropdownIndicator: () => null,
        IndicatorSeparator: () => null,
      }}
      styles={customStyles}
      className="chooseCountrySelect"
      options={optionsSector}
    />
  );
}
export default SelectWorldOrSector;
